import React from 'react';
import './Footer.css';
import { Link } from 'react-router-dom';
class Footer extends React.Component {
  render() {
    return (
      <div className='container-fluid'>
        <div className='header'>
          <div className='header-top'>
            <div className='top-header'>
              <Link to='/'>
                <img src='/picture/travel-homepage.png' alt='' />
              </Link>
            </div>
          </div>
          <div className='main-header'>
            <nav class='navbar navbar-expand-lg navbar-light'>
              <div class='form-search'>
                <div className='toggle-icon' onClick={this.showSearch}>
                  {isShowSearch ? (
                    <i class='fa-solid fa-xmark' />
                  ) : (
                    <i class='fa-solid fa-magnifying-glass' />
                  )}
                </div>

                <form className='search-box'>
                  {isShowSearch && (
                    <input
                      type='text'
                      className='text search-input'
                      value={searchData}
                      onChange={this.handleSearchChange}
                      placeholder='Search'
                    />
                  )}
                  {isShowSearch && (
                    <input
                      type='button'
                      value='Search'
                      className='btn-submit'
                      onClick={(e) =>
                        this.handleSubmitSearch(e, this.props.children.props)
                      }
                    />
                  )}
                </form>
              </div>

              <button
                class='navbar-toggler'
                type='button'
                data-toggle='collapse'
                data-target='#navbarSupportedContent'
                aria-controls='navbarSupportedContent'
                aria-expanded='false'
                aria-label='Toggle navigation'
              >
                <span class='navbar-toggler-icon'></span>
              </button>
              <div
                class='mobile-menu collapse navbar-collapse'
                id='navbarSupportedContent'
              >
                <ul class='navbar-nav mr-auto'>
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/about'>
                      News
                    </Link>
                  </li>
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/product'>
                      Viettravel's Diary
                    </Link>
                  </li>
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/users'>
                      Around the Word
                    </Link>
                  </li>
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/users'>
                      Ptomotion
                    </Link>
                  </li>{' '}
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/users'>
                      Media
                    </Link>
                  </li>{' '}
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/users'>
                      Contact
                    </Link>
                  </li>
                  <li class='nav-item '>
                    <Link class='navbar-brand' to='/logout'>
                      Logout
                    </Link>
                  </li>
                </ul>
              </div>
            </nav>
          </div>

          <section class='banner'>
            <img src='/picture/main-picture.jpg' alt='banner' />
          </section>
        </div>
      </div>
      // <div className='container-fluid footer'>
      //   <div className='social-media'>
      //     <div className='homepage'>
      //       <Link to='/'>
      //         <img src='/picture/logo.png' />
      //       </Link>
      //     </div>
      //     <br />
      //     <Link>
      //       <img src='https://caodang.fpt.edu.vn/wp-content/themes/poly-2015/images/ico-fb-landing.png' />
      //     </Link>

      //     <Link>
      //       <img src='https://caodang.fpt.edu.vn/wp-content/themes/poly-2015/images/ico-youtube-landing.png' />
      //     </Link>

      //     <Link>
      //       <img src='https://caodang.fpt.edu.vn/wp-content/uploads/icon-tiktok.png' />
      //     </Link>
      //   </div>
      //   <div className='system-student'>
      //     <h5>HỆ THỐNG VĂN PHÒNG TUYỂN SINH</h5>
      //     <div>Cơ sở Hà Nội</div>
      //     <p>
      //       <i class='fa-solid fa-location-dot' />
      //       {''} {''}
      //       Văn phòng Tuyển sinh: Tòa nhà FPT Polytechnic, phố Trịnh Văn Bô,
      //       phường Phương Canh, quận Nam Từ Liêm, TP Hà Nội
      //       <br />
      //       <i class='fa-solid fa-square-phone' /> {''} {''}(024) 8582 0808
      //     </p>
      //     <div>Cơ sở Hà Nội</div>
      //     <p>
      //       <i class='fa-solid fa-location-dot' />
      //       {''} {''}
      //       Văn phòng Tuyển sinh: Tòa nhà FPT Polytechnic, phố Trịnh Văn Bô,
      //       phường Phương Canh, quận Nam Từ Liêm, TP Hà Nội <br />
      //       <i class='fa-solid fa-square-phone' /> {''} {''}(024) 8582 0808
      //     </p>
      //     <div>Cơ sở Hà Nội</div>
